import React from 'react';
import Header from './components/Header';
import Hero from './components/Hero';
import Features from './components/Features';
import AboutUs from './components/AboutUs';  // New About Us Section
import ContactUs from './components/ContactUs'; // New Contact Us Section
import Footer from './components/Footer';

const App = () => {
  return (
    <>
      <Header />
      <Hero />
      <AboutUs />  {/* Add About Us Section */}
      <Features />
      <ContactUs /> {/* Add Contact Us Section */}
      <Footer />
    </>
  );
};

export default App;
